        [TestMethod]
        public void ClassificationNeuralNetModel_PredictProbability_Multiple()
        {
            var parser = new CsvParser(() => new StringReader(Resources.Glass));
            var features = parser.EnumerateRows(v => v != "Target").First().ColumnNameToIndex.Keys.ToArray();
            var normalizer = new MinMaxTransformer(0.0, 1.0);
            var observations = parser.EnumerateRows(features)
                .ToF64Matrix();

            normalizer.Transform(observations, observations);

            var targets = parser.EnumerateRows("Target").ToF64Vector();
            var rows = targets.Length;

            var learner = new ClassificationMomentumNeuralNetLearner(new HiddenLayer[] { HiddenLayer.New(50) }, new ReluActivation(), new LogLoss(),
                100, 0.1f, 20, 0, 0.0, LearningRateSchedule.InvScaling);

            var sut = learner.Learn(observations, targets);

            var actual = sut.PredictProbability(observations);

            var evaluator = new TotalErrorClassificationMetric<double>();
            var error = evaluator.Error(targets, actual.Select(p => p.Prediction).ToArray());

            Assert.AreEqual(0.23831775700934579, error, 1e-6);

            var expected = new ProbabilityPrediction[] { new ProbabilityPrediction(1, new Dictionary<double, double> { { 1, 0.734854578971863 }, { 2, 0.096395805478096 }, { 3, 0.167946919798851 }, { 5, 8.62267825141316E-06 }, { 6, 0.000245073926635087 }, { 7, 0.000548955926205963 }, }), new ProbabilityPrediction(1, new Dictionary<double, double> { { 1, 0.440324127674103 }, { 2, 0.336113184690475 }, { 3, 0.192999839782715 }, { 5, 0.000144347286550328 }, { 6, 0.0170937590301037 }, { 7, 0.0133247235789895 }, }), new ProbabilityPrediction(2, new Dictionary<double, double> { { 1, 0.281154423952103 }, { 2, 0.555409014225006 }, { 3, 0.139360368251801 }, { 5, 0.000300007872283459 }, { 6, 0.0116413533687592 }, { 7, 0.0121349059045315 }, }), new ProbabilityPrediction(1, new Dictionary<double, double> { { 1, 0.591069102287292 }, { 2, 0.255445837974548 }, { 3, 0.147174268960953 }, { 5, 0.000118745963845868 }, { 6, 0.00189955905079842 }, { 7, 0.00429251976311207 }, }), new ProbabilityPrediction(1, new Dictionary<double, double> { { 1, 0.634522676467896 }, { 2, 0.213996514678001 }, { 3, 0.142973572015762 }, { 5, 8.72145392349921E-05 }, { 6, 0.00316592515446246 }, { 7, 0.00525400182232261 }, }), new ProbabilityPrediction(2, new Dictionary<double, double> { { 1, 0.248218879103661 }, { 2, 0.688224017620087 }, { 3, 0.062169261276722 }, { 5, 0.000396741495933384 }, { 6, 5.2821957069682E-05 }, { 7, 0.000938230834435672 }, }), new ProbabilityPrediction(1, new Dictionary<double, double> { { 1, 0.693885445594788 }, { 2, 0.15413573384285 }, { 3, 0.143823638558388 }, { 5, 6.48898349027149E-05 }, { 6, 0.00330571387894452 }, { 7, 0.0047846375964582 }, }), new ProbabilityPrediction(1, new Dictionary<double, double> { { 1, 0.768050611019135 }, { 2, 0.104964949190617 }, { 3, 0.121443368494511 }, { 5, 4.44992801931221E-05 }, { 6, 0.00202783290296793 }, { 7, 0.00346865877509117 }, }), new ProbabilityPrediction(1, new Dictionary<double, double> { { 1, 0.469160377979279 }, { 2, 0.261614769697189 }, 